import React from "react";
import PageHeaderContent from "../../components/pageHeaderContents";
import resume from '../../asset/Shivani_Resume.pdf'


const Resume =() => {
    return (
        <div>
        <PageHeaderContent headerText="Resume" >
        </PageHeaderContent>
        <button className="resume__download-button" href={resume} download='resume'>Download</button>
       </div>
    )
}
export default Resume;
